import React from 'react'

function Navbar() {
  return (
    <div style={styles.topBar}>
      <div style={styles.logo}>BrandName</div>
      <div style={styles.menu}>
        <a href="#home" style={styles.menuItem}>Home</a>
        <a href="#about" style={styles.menuItem}>About</a>
        <a href="#services" style={styles.menuItem}>Services</a>
        <a href="#contact" style={styles.menuItem}>Contact</a>
      </div>
    </div>
  );
};

const styles = {
  topBar: {
    display: 'inline-block',
    alignItems: 'center',
    justifyContent: 'space-between',
    padding: '15px 30px',
    background: 'linear-gradient(90deg, #4a90e2, #50c9c3)',
    color: 'white',
    boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.1)',
    position: 'fixed',
    width: '100%',
    top: 0,
    zIndex: 1000,
  },
  logo: {
    fontSize: '24px',
    fontWeight: 'bold',
    letterSpacing: '1px',
  },
  menu: {
    display: 'flex',
    gap: '20px',
  },
  menuItem: {
    color: 'white',
    textDecoration: 'none',
    fontSize: '16px',
    fontWeight: '500',
    transition: 'color 0.3s ease',
  },
};


export default Navbar
